import React from 'react';

import Do from './Do';

/**
 * タスクのコンポ
 */
class Task extends React.Component {

	constructor() {
		super();
		this.state = {
			todoList: this.props.todoList
		}
	}

	render() {
		const todoList = this.props.todoList.map(todo =>
			<Do key={todo.task}
				{...todo}
			/>
		)
		return (
			<div>
				<li>
					<input type='checkbox' />
					{/*listを作って追加していく*/}
				</li>
				<hr />
			</div>
		);
	}
}

Task.propTypes = {
	// isRequired 必須項目
	todoList: PropTypes.array.isRequired
}

export default Task;
